import React, {useState} from 'react';
import axios from 'axios';
const Info=()=>{
  const [datas,setDatas]=useState(null)
    fetch("http://localhost:3001/read")
 .then(res=>res.json())
 .then(data =>{
   setDatas(data);
 })
 .catch(err=>console.log(err))
  return <>
  {datas?.payload.findAll.map(todo =><li key={todo.id}>{todo}</li>)}
  </>
}
export default Info;
